<script>
    function generateSessionId() {
      let session_id = window.sessionStorage.getItem("session_id");
      if (session_id) return session_id;
      session_id = "";
      let characters =
        "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";
      let charactersLength = 30;
      for (var i = 0; i < charactersLength; i++) {
        session_id += characters.charAt(
          Math.floor(Math.random() * characters.length)
        );
      }
      window.sessionStorage.setItem("session_id", session_id);
      return session_id
    }

    function isAndroid() {
      if (navigator.userAgent.match(/android/i)) {
        return true
      }
    }

    function isIOS() {
      if (navigator.userAgent.match(/(iPhone|iPod|iPad|Macintosh);?/i)) {
        return true
      }
    }

    function getPlatform() {
      if (this.isAndroid()) {
        return "android"
      }
      if (this.isIOS()) {
        return "ios"
      }
      return "unknown"
    }

    if (window.product_info && window.track_enable) {
      var channel = window.product_info["channel"]
      var page_name = window.product_info["page_name"]
      var product = window.product_info["product"]
      const data = {
        event_name: 'page_ready_view',
        event_type: 'page_ready_view',
        language: navigator.language,
        page_type: 'playable',
        channel: channel | "unknown",
        product: product | "unknown",
        page_name: page_name | "unknown",
        session_id: generateSessionId(),
        playable_device: getPlatform(),
        refer: document.referrer,
        params: {
          device_model: navigator.userAgent,
          release_mode: window["release_mode"]
        }
      }
      const track = function (data) {
        fetch("https://h5-jackpotwins.com/api/event/webTrack", {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify(data)
        })
      }
      track(data)
    }
